import React from 'react';
import { Flex, Heading, Center } from "@chakra-ui/core";
import { styled } from "../theme";

const Wrapper = styled(Center)({
    width: "100vw",
    height: "3rem",
    padding: "2rem"
})
export const Header = () => {
    return (
        <Wrapper>
            <Flex>
                <Heading as="h3" size="md" marginLeft="2rem">Home</Heading>
                <Heading as="h3" size="md" marginLeft="2rem">Learn</Heading>
                <Heading as="h3" size="md" marginLeft="2rem">Move on</Heading>
                <Heading as="h3" size="md" marginLeft="2rem">Result</Heading>
            </Flex>
        </Wrapper>
    )
}
